BoothResponseData boothResponseDataFromJson(String str) => BoothResponseData.fromJson(json.decode(str));
String boothResponseDataToJson(BoothResponseData data) => json.encode(data.toJson());
class BoothResponseData {
  BoothResponseData({
      num? count, 
      String? message, 
      List<Parts>? parts,}){
    _count = count;
    _message = message;
    _parts = parts;
}

  BoothResponseData.fromJson(dynamic json) {
    _count = json['count'];
    _message = json['message'];
    if (json['parts'] != null) {
      _parts = [];
      json['parts'].forEach((v) {
        _parts?.add(Parts.fromJson(v));
      });
    }
  }
  num? _count;
  String? _message;
  List<Parts>? _parts;
BoothResponseData copyWith({  num? count,
  String? message,
  List<Parts>? parts,
}) => BoothResponseData(  count: count ?? _count,
  message: message ?? _message,
  parts: parts ?? _parts,
);
  num? get count => _count;
  String? get message => _message;
  List<Parts>? get parts => _parts;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['count'] = _count;
    map['message'] = _message;
    if (_parts != null) {
      map['parts'] = _parts?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

